import React from 'react';
import ReactDOM from 'react-dom';

const Hello = () => {
  return (
    <div>
      <p>Hello Meeples</p>
    </div>
  )
}

const Meep = () => {
  return (
    <div>
      <h2>This is my MEEP.</h2>
    </div>
  )
}

const App = () => {
  return (
    <div>
      <Meep />
      <h1>MEEP.</h1>
      <Hello />
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
